import React from 'react'
import { BackgroundContainer, } from './MovieStyle'

const Background = () => {
  return (
    <BackgroundContainer>
        <ContainerBg>
            <VideoBg autoPlay loop muted src= {Video} type= 'video/mp4'/>

        </ContainerBg>





    </BackgroundContainer>
  )
}

export default Background
